import React from 'react';
import Reveal from 'react-reveal/Reveal/';
// import  how_it_work from '../../../../assets/img/gfew_img/how-it-works_1.png';
// import  how_it_works_chef from  '../../../../assets/img/gfew_img/how-it-works_1-chef.png';
// import  skill_1 from '../../../../assets/img/gfew_img/1_1.jpg';
// import  skill_2 from '../../../../assets/img/gfew_img/1_2.jpg';
// import  skill_3  from '../../../../assets/img/gfew_img/1_3.jpg';
// import  skill_4  from '../../../../assets/img/gfew_img/1_4.jpg';
// import how_it_works_1_register from  '../../../../assets/img/gfew_img/how-it-works_1-register.png';
// import  '../../../../assets/img/gfew_img/how-it-works_1.png';

const Todo = () => {
    return(
        <>
        <section id="main-context">
			<div class="container-fluid">
					<div class="row mt-5">
							<div class="col-12 col-lg-6 d-flex align-items-center text-justify justify-content-center text-uppercase">
								<p>
										We'LL send you your eat well box of ingredients This might be as exciting of the class itself. <br /> A few  Days before your class, A  boxed will arrived filled 
									with premium , pre measured ingredients along  with recipes.

								</p>	
							</div>
							<div class="col-12 col-lg-6">
									<lottie-player src="https://assets3.lottiefiles.com/packages/lf20_TmewUx.json" background="transparent"  speed="1"  style="width: 100%; height: 100%;" loop controls autoplay></lottie-player>
							</div>
					</div>
					<div class="row ">

							<div class="col-12 col-lg-6">
									<lottie-player src="https://assets2.lottiefiles.com/packages/lf20_n8GX5U.json" background="transparent"  speed="1"  style="width: 100%; height: 100%;" loop controls autoplay></lottie-player>
							</div>
							<div class="col-12 col-lg-6 d-flex align-items-center text-justify justify-content-center text-uppercase">
								<p>
										Pick up your fresh ingredients. A shopping list of those <br /> ingredients is emailed to you in advance.

								</p>	
							</div>
					</div>

			</div>
	  </section>

	  <section id="country">
				<div class="container-fluid">
						<div class="row pt-5 ">
								<div class="col-12 col-lg ml-0 ml-lg-5 pt-5 mt-5">
										<h2 class="text-uppercase">What country do you want to cook with?</h2>
										<p class="mt-4">Make sure to select your own timezone and country. <br />
											our chef lives all over the world.
										</p>
								</div>
								<div class="col-12 col-lg">
										<lottie-player src="https://assets9.lottiefiles.com/packages/lf20_pHl01w.json" background="transparent"  speed="1"  style="width: 100%; height: 100%;" loop controls autoplay></lottie-player>
								</div>
						</div>
						<div class="row py-5">

								<div class="col-12 col-lg ">
										<lottie-player src="https://assets10.lottiefiles.com/packages/lf20_9qqzSo.json" background="transparent"  speed="1"  style="width: 100%; height: 100%;" loop controls autoplay></lottie-player>
								</div>
								<div class="col-12 col-lg ml-0 ml-lg-5 pt-5 mt-5">
										<h2 class="text-uppercase">You can also create battles</h2>
										<p class="mt-4"> You can create battles and compete with other chef as a single or by <br /> creating a team. It will help you to skill up your cooking.
										</p>
								</div>
						</div>

				</div>
	  </section> 
      </>
    )
}
export default Todo;



